import React from 'react';
import { Link } from 'react-router-dom';
import '../Section/Section.css';
import foto from '../../images/earth.gif';
import gpi from '../../images/gpi.png';
import asi from '../../images/asi.png';
import './Projects.css';
import videoProjects from '../../video/video_projects.mp4';
import { useEffect } from 'react';

import AwesomeSlider from 'react-awesome-slider';
import 'react-awesome-slider/dist/styles.css';
import { 
  Provider,
  Link as SliderLink,
  withNavigationContext,
  withNavigationHandlers
} from "react-awesome-slider/dist/navigation";

// Wrapp the AwesomeSlider component with the navigationHandlers
const NavigationSlider = withNavigationHandlers(AwesomeSlider);

const Slider = () => {
  return (
    <NavigationSlider
      className="awesome-slider"
      media={[
        {
          slug: "page-one",
          className: "page-one",
          children: () => <p>Page One</p>
        },
        {
          slug: "page-two",
          className: "page-two",
          children: () => <p>Page Two</p>
        }
      ]}
    />
   )
}


const Header = () => {
  return (
    <div>
      <nav>
        <SliderLink href="page-one">Page One</SliderLink>
        <SliderLink href="page-two">Page Two</SliderLink>
      </nav>
    </div>
  )
}

const Nav = () => {
  const slug = "[THE INITIAL RENDERED SLUG]";

  return (
    <Provider slug={slug}>
      <Header />
      <NavigationSlider />
    </Provider>
  )
}

export default function Products() {

  useEffect(() => {
    window.scrollTo(0, 0)
  }, [])

  return (

    <>

      <video className='videoTag' autoPlay loop muted>
        <source src={videoProjects} type='video/mp4' />
      </video>
      <div className="proj-intro">
        <h2 className="proj-intro-title"> Our Projects </h2>
        <h6 className="proj-intro-links"> Video by cottonbro from Pexels</h6>
      </div>


      {/* First card that has information on dVox */}
      <div className="project-cardContainer">
        {/* This section is where dVox logo will be placed */}
        <div className="project-align-img">
          <img src={foto} alt="background" className="project-placeimg" />
        </div>

        {/* This section contains information on dVox */}
        <div className="project-dVox-Container">
          <h1 className="project-dVox-title">dVox</h1>
          <p className="project-dVox-description">
            dVox is about Est consectetur incididunt sint cillum consectetur 
            officia culpa labore enim ipsum minim dolor nostrud ipsum. Esse 
            commodo proident ex eiusmod ad deserunt ullamco cupidatat magna 
            eu mollit in proident. Consequat eu reprehenderit ex velit officia
             nisi non. Quis anim commodo exercitation reprehenderit nostrud enim
            duis.
          </p>
          <div className="project-dVox-learnmore">
           <Link to='/dvox'>
              Learn more about dVox
            </Link>
          </div>
          {/* This contains the icons where user will click and show app */}
          <div className="project-dvox-apps">
            <img src={asi} alt="background" className="project-appleStore-img" />
            <img src={gpi} alt="background" className="project-googlePlay-img" />
          </div>
        </div>

      </div>

      {/* Second card that has information on css */}
      <div className="project-cardContainer">
        {/* This code gives description on css */}
        <div className="project-css-Description-Container">
          <div className="project-padding-cssTitle">
            <h1>Computer Science Society</h1>
          </div>
          <p className="project-css-Description-text">Computer Science Society is Cillum sunt velit reprehenderit cupidatat sunt nisi labore et incididunt cillum aliqua. Laboris fugiat fugiat commodo ut. Mollit aliqua enim mollit fugiat est aliqua laborum aliquip sunt occaecat voluptate.</p>
          <Link to='/css'>
            Learn more about CSS
          </Link>
        </div>

        {/* This code is where the logo will be placed */}
        <div className="project-align-img">
          <img src={foto} alt=" background" className="project-placeimg" />
        </div>
      </div>
    </>

  )

}
